public class maximum_subarray \{


 public static void maxSubarray\(int arr\[\]\)\{
 int temp\=0\;
 int sum\= Integer\.MIN_VALUE\;

 for\(int i\=0\;i\< arr\.length\;i\+\+\)\{
 temp\+\=arr\[i\]\;

 if\(sum\< temp\)\{
 sum\=temp\;
 \}

 if\(temp\< 0\)\{
 temp\=0\;
 \}
 \}

 return sum\;


 \}


 public static void main\(String args\[\]\)\{
 int arr\[\] \=\{1\,2\,3\,4\}\;
 maxSubarray\(arr\)\;


 \}


\}

